import React from "react";
import { Link } from "react-router-dom";
import { Menu, Icon } from 'antd';
import './styling/app.css';
import LoginForm from './Second';
import Signup from './Signup';
import { BrowserRouter as Router } from 'react-router-dom';

const SubMenu = Menu.SubMenu;



function Header() { 
  return (
    <Menu
    style={{ width: 256 }}
    defaultSelectedKeys={['1']}
    defaultOpenKeys={['sub1']}
    mode="inline"
  >

    <SubMenu className='nAv' key="sub2" title={<span><Icon type="appstore" /><span>Welcome</span></span>}>
      <Menu.Item key="5"><Link to="/">Home</Link></Menu.Item>
      <Menu.Item key="6"><Link to="/first">First</Link></Menu.Item>
      <SubMenu key="sub3" title="Ready For More">
        <Menu.Item key="7"><Link to="/third">Second</Link></Menu.Item>
        <Menu.Item key="8"><Link to="/second">Signup</Link></Menu.Item>
      </SubMenu>
    </SubMenu>

    <Router
          path="/login"
          render={() =>
            <LoginForm
              updateUser={this.updateUser}
            />}
        />
        <Router
          path="/signup"
          render={() =>
            <Signup/>}
        />
  </Menu>
);
}

export default Header;
